//steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/mana.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 140/150/160/170</div><div class=\\\"cooldown\\\"><img alt=\\\"Cooldown\\\" title=\\\"Cooldown\\\" class=\\\"cooldownImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/cooldown.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 34/31/28/25</div><br clear=\\\"left\\\" /></div>\",\"lore\":\"The fae realm exists all around you, merely waiting to draw you in...\",\"hurl\":\"dark_willow\"},\"dark_willow_shadow_realm\":{\"dname\":\"Shadow Realm\",\"affects\":\"ABILITY: <span class=\\\"attribVal\\\">No Target</span><br />DAMAGE TYPE: <span class=\\\"attribVal\\\">Magical</span><br />PIERCES SPELL IMMUNITY: <span class=\\\"attribVal\\\">No</span><br />\",\"desc\":\"Dark Willow recedes into the shadows, becoming untargetable.  Her next attack has increased attack range and deals bonus magic damage, and will end Shadow Realm. Damage scales based on how long she remains under the effects of Shadow Realm, the maximum being reached after %max_damage_duration% seconds.\",\"notes\":\"\",\"dmg\":\"\",\"attrib\":\"DURATION: <span class=\\\"attribVal\\\">5</span><br />\\nATTACK RANGE BONUS: <span class=\\\"attribVal\\\">600</span>\",\"cmb\":\"<div class=\\\"cooldownMana\\\"><div class=\\\"mana\\\"><img alt=\\\"Mana Cost\\\" title=\\\"Mana Cost\\\" class=\\\"manaImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/mana.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 70/80/90/100</div><div class=\\\"cooldown\\\"><img alt=\\\"Cooldown\\\" title=\\\"Cooldown\\\" class=\\\"cooldownImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/cooldown.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 30/24/18/12</div><br clear=\\\"left\\\" /></div>\",\"lore\":\"What you can't see will most definitely hurt you.\",\"hurl\":\"dark_willow\"},\"dark_willow_cursed_crown\":{\"dname\":\"Cursed Crown\",\"affects\":\"ABILITY: <span class=\\\"attribVal\\\">Unit Target</span><br />AFFECTS: <span class=\\\"attribVal\\\">Enemy Units</span><br />PIERCES SPELL IMMUNITY: <span class=\\\"attribVal\\\">No</span><br />\",\"desc\":\"Dark Willow casts an ancient fae curse on the target. After a delay, the target and nearby enemies are stunned.\",\"notes\":\"\",\"dmg\":\"\",\"attrib\":\"DELAY: <span class=\\\"attribVal\\\">4</span><br />\\nSTUN DURATION: <span class=\\\"attribVal\\\">2 / 2.5 / 3 / 3.5</span><br />\\nSTUN RADIUS: <span class=\\\"attribVal\\\">325</span>\",\"cmb\":\"<div class=\\\"cooldownMana\\\"><div class=\\\"mana\\\"><img alt=\\\"Mana Cost\\\" title=\\\"Mana Cost\\\" class=\\\"manaImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/mana.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 80/100/120/140</div><div class=\\\"cooldown\\\"><img alt=\\\"Cooldown\\\" title=\\\"Cooldown\\\" class=\\\"cooldownImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/cooldown.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 18/16/14/12</div><br clear=\\\"left\\\" /></div>\",\"lore\":\"Didn't anyone ever tell you? Never strike a deal with a fairy...\",\"hurl\":\"dark_willow\"},\"dark_willow_bedlam\":{\"dname\":\"Bedlam\",\"affects\":\"ABILITY: <span class=\\\"attribVal\\\">No Target</span><br />AFFECTS: <span class=\\\"attribVal\\\">Enemies</span><br />DAMAGE TYPE: <span class=\\\"attribVal\\\">Magical</span><br />PIERCES SPELL IMMUNITY: <span class=\\\"attribVal\\\">No</span><br />\",\"desc\":\"Dark Willow's pet wisp roams around her for the duration, rapidly attacking nearby enemies.  Bedlam cannot be used while Terrorize is active.\",\"notes\":\"\",\"dmg\":\"\",\"attrib\":\"ATTACK DAMAGE: <span class=\\\"attribVal\\\">60 / 120 / 180</span><br />\\nATTACK INTERVAL: <span class=\\\"attribVal\\\">0.25</span><br />\\nATTACK RADIUS: <span class=\\\"attribVal\\\">300</span><br />\\nATTACK TARGETS: <span class=\\\"attribVal\\\">1</span><br />\\nROAMING RADIUS: <span class=\\\"attribVal\\\">200</span><br />\\nROAMING DURATION: <span class=\\\"attribVal\\\">5</span>\",\"cmb\":\"<div class=\\\"cooldownMana\\\"><div class=\\\"mana\\\"><img alt=\\\"Mana Cost\\\" title=\\\"Mana Cost\\\" class=\\\"manaImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/mana.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 100/150/200</div><div class=\\\"cooldown\\\"><img alt=\\\"Cooldown\\\" title=\\\"Cooldown\\\" class=\\\"cooldownImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/cooldown.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 30</div><br clear=\\\"left\\\" /></div>\",\"lore\":\"You'll have to excuse my friend Jex. He's really into murder.\",\"hurl\":\"dark_willow\"},\"dark_willow_terrorize\":{\"dname\":\"Terrorize\",\"affects\":\"ABILITY: <span class=\\\"attribVal\\\">Point Target</span><br />AFFECTS: <span class=\\\"attribVal\\\">Enemies</span><br />PIERCES SPELL IMMUNITY: <span class=\\\"attribVal\\\">No</span><br />\",\"desc\":\"Dark Willow releases her pet wisp to terrorize her enemies. After a short delay, all enemies in the target area become fearful and run toward their home fountain. Terrorize cannot be used while Bedlam is active.\",\"notes\":\"\",\"dmg\":\"\",\"attrib\":\"\",\"cmb\":\"<div class=\\\"cooldownMana\\\"><div class=\\\"mana\\\"><img alt=\\\"Mana Cost\\\" title=\\\"Mana Cost\\\" class=\\\"manaImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/mana.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 150</div><div class=\\\"cooldown\\\"><img alt=\\\"Cooldown\\\" title=\\\"Cooldown\\\" class=\\\"cooldownImg\\\" src=\\\"https://steamcdn-a.akamaihd.net/apps/dota2/images/tooltips/cooldown.png\\\" width=\\\"16\\\" height=\\\"16\\\" border=\\\"0\\\" /> 100/80/60</div><br clear=\\\"left\\\" /></div>\",\"lore\":\"You think you know the first thing about fear? Jex'll show you what that word truly means...\",\"hurl\":\"dark_willow\"},\"special_bonus_unique_dark_willow_1\":{\"dname\":\"+300 Shadow Realm Max Damage\",\"affects\":\"ABILITY: <span class=\\\"attribVal\\\">Passive</span><br />\",\"desc\":\"DOTA_Tooltip_ability_special_bonus_unique_dark_willow_1_Description\",\"notes\":\"\",\"dmg\":\"\",\"attrib\":\"\",\"cmb\":\"\",\"lore\":\"\",\"hurl\":\"dark_willow\"},\"special_bonus_attack_speed_200\":{\"dname\":\"+200 Attack Speed\",\"affects\":\"ABILITY: <span class=\\\"attribVal\\\">Passive</span><br />\",\"desc\":\"DOTA_Tooltip_ability_special_bonus_attack_speed_200_Description\",\"notes\":\"\",\"dmg\":\"\",\"attrib\":\"\",\"cmb\":\"\",\"lore\":\"\",\"hurl\":\"dark_willow\"},\"special_bonus_unique_dark_willow_2\":{\"dname\":\"+1 Terrorize Duration\",\"affects\":\"ABILITY: <span class=\\\"attribVal\\\">Passive</span><br />\",\"desc\":\"DOTA_Tooltip_ability_special_bonus_unique_dark_willow_2_Description\",\"notes\":\"\",\"dmg\":\"\",\"attrib\":\"\",\"cmb\":\"\",\"lore\":\"\",\"hurl\":\"dark_willow\"}}};\n\n//# sourceURL=webpack:///./jsonBackUp/abilities.json?");

